import React from "react";
import { Link } from "react-router-dom";

function MainPage() {
    return (
        <div className={'text-3xl'}>
            <div>Main Page</div>

            <div>
                <Link to={'/about'}></Link>
            </div>
        </div>
    );
}

export default MainPage;
